import React from "react";

export default function SingleTitle({ text, filled }) {
  return (
    <div
      style={{
        padding: 10,
        backgroundColor: filled ? "#B1BC55" : "white",
        color: filled ? "white" : "#B1BC55",
        display: "inline-flex",
        borderWidth: filled ? 0 : 5,
        borderColor: "#B1BC55",
      }}
    >
      {text}
    </div>
  );
}
